function getAnswer() {
    let q = +$('#questionNumber').val();

    if (!q) $('#answers').text('');

    let json = pspAnswers();

    for (let elem of json) {
        if (q == elem.id) {
            return $('#answers').text(elem.answer);
        }
    }
    return $('#answers').text('');
}
